import './App.css';
import axios from 'axios';

var ver;

var hey = async () => {
  axios.get('http://localhost:4000/data')
  .then(res => {
    ver = JSON.stringify(res.data.data);
    console.log('res: '+ JSON.stringify(res));
  })
};

hey()

