function App() {
  return (
    <div>
      <nav>
       Comic Viewer
      </nav>
      <div id="body">
        <input type="text" name="" id="Number"/>
        <input type="button" value="Random"/>
        <div id="comic">
          <div id="previous">&lt;-</div>
          <img src="https://imgs.xkcd.com/comics/product_launch.png" alt="Comic" id="comicImg"/>
          <div id="next">-&gt;</div>
        </div>
        <input type="button" value="Transcript"/>
        <p>[[A sketch of an Island]] {hey}</p>
      </div>
    </div>
  );
}

export default App;
